bool searchFrom(const std::vector<std::vector<char>>& grid, int x, int y) {

    int n = grid.size();
    int m = grid[0].size();
    if (x <= 0 || x >= n - 1 || y <= 0 || y >= m - 1) return false;

    if ((grid[x + 1][y + 1] == 'M' && grid[x - 1][y - 1] == 'S' &&
        grid[x + 1][y - 1] == 'S' && grid[x - 1][y + 1] == 'M') ||
        (grid[x + 1][y + 1] == 'S' && grid[x - 1][y - 1] == 'M' &&
        grid[x + 1][y - 1] == 'M' && grid[x - 1][y + 1] == 'S') ||
        (grid[x + 1][y + 1] == 'M' && grid[x - 1][y - 1] == 'S' &&
        grid[x + 1][y - 1] == 'M' && grid[x - 1][y + 1] == 'S') ||
        (grid[x + 1][y + 1] == 'S' && grid[x - 1][y - 1] == 'M' &&
        grid[x + 1][y - 1] == 'S' && grid[x - 1][y + 1] == 'M')) {
        return true;
    }
    return false;
}



